    {
      marca: "Seat",
      modelo: "Ibiza",
      precio: "5.900 €",
      km: "2500 km",
      img: ruta + "seatIbiza.jpg",
      portada: false,
      venta: true
    },
    {
      marca: "VolksWagen",
      modelo: "Partner",
      precio: "8.900 €",
      km: "2500 km",
      img: ruta + "peugeotPartner.jpg",
      portada: false,
      venta: true
    }
  ]);

  return (
    <>
      <h1>Concesionario Vioño</h1>
      <NavBar vehiculos={vehiculosArray} />
      <h3>Ofertas alquiler</h3>
      <CarCarrousel vehiculos={vehiculosArray} />
    </>

  );
}

export default App;
